// インタラクティビティの追加を学ぶ

// イベントハンドラにおいてpropsの読み取りを実施したいと思います。

function Button({ onClick, children }) {
  return(
    <button onClick={onClick} type="button">
      {children}
    </button>
  )
}

function PlayButton({movieName}){
  function handleClick(){
    console.log("${movieName}を再生します");
  }

  return (
    <Button onClick={handleClick}>
      Play"{movieName}"
    </Button>
  )
}

function UploadButton(){
  return(
    <Button onClick={()=>alert("アップロードします")}>
      Upload Image
    </Button>
  )
}


export default function App() {
  // 動画のアップロードと画像のアップロードについて

  return(
    <div>
      <PlayButton movieName="Inception"/>
      <UploadButton />
    </div>
  )
}
